export default function Hoodies() {
  function addtoCart() {
    let pricing = 0;
    const hoodie = document.querySelector(".addhoodie");
    hoodie.addEventListener("click", () => {
      pricing += 50;
    });

    const tshirt = document.querySelector(".addtshirt");
    tshirt.addEventListener("click", () => {
      pricing += 70;
    });

    const cases = document.querySelector(".addcase");
    cases.addEventListener("click", () => {
      pricing += 70;
    });
  }

  return (
    <div className="container">
      <h1>Hoodies</h1>
      <button onClick={addtoCart} className="addhoodie">
        50
      </button>
    </div>
  );
}
